import "./aboutmeimage.css"

export default function aboutmeimage() {
const imagePath = require('./rishab.jpg');
  return (
        <>
        <div className='imagewrapper'>
                <img className="aboutmeImg" src={imagePath}/>
        </div>
        <div>aboutmeimage</div>
        </>
  )
}
